const gitUserdata=(
    state={
        loading:false,
        error:null,
        data:null,
        status:null
    },action)=>{
        switch(action.status)
            {
                case userAction.REQUEST:
                return Object.assign({},state,{
                    status:action.status,
                    loading:true
                });
                case userAction.SUCCESS:
                return Object.assign({}, state, {
                  status: action.status,
                  loading: false,
                  userData: action.userdata
                });
                case userAction.FAILURE:
                return Object.assign({}, state, {
                  status: action.status,
                  loading: false,
                  error: action.error
                });
                default:
                return state;
            }
    };
